import Post from './Post';
import '../style/Posts.css';
import posts from '../data/postData.js';
import React, { Component } from 'react';

class Posts extends Component {
  render() {
    return (
      <div>
        {posts.map((test) => {
          return <Post post={test} />
        })}
      </div>
    );
  }
}

export default Posts;
